import React, {Component} from 'react';
import algData from '../../data/alg-data'
import './nav.css'
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';

export default class Navbar extends Component {

    render(){
        const showNav = this.props.state.showNav
        const items = ['Start', 'Target', 'Wall', 'Weight', 'Stop']
        const currItem = this.props.state.currItemObj
        const currAlg = this.props.state.currAlgObj

        return(
            <div className={`nav-bar nav-${showNav ? 'active' : 'inactive'}`}>
                <div className="algs-container">
                    <div className="alg-selector">
                        <Tabs
                            orientation="vertical"
                            TabIndicatorProps={{style: {background:'black'}}}
                            value={this.props.state.currAlgTab}
                            onChange={this.props.handleTabs}
                            variant="scrollable"

                        >
                            {algData.map((alg, val) => {
                                return <Tab className="alg-tab" label={<span className="alg-tab-text">{`${alg.name}`}</span>} value={val} />
                            })}
                        </Tabs>
                    </div>
                    <div className="alg-card">
                        <h2 className="alg-card-title">{currAlg.name}</h2>
                        <p className="alg-card-desc">{currAlg.description}</p>
                    </div>
                </div>
                <div className="items-container">
                    <div className="items-selector">
                        {items.map((item, i) => {
                            const isCurrItem = this.props.state.currItemDesc === item
                            return (
                                <a className={`item-btn item-btn-${isCurrItem ? 'active' : 'inactive'} ${i===0 ? 'first-btn' : ''} ${i===(items.length-1) ? 'last-btn' : ''}`} id={`${item}-btn`}
                                onClick={(e) => {this.props.handleItemChange(e, item)}}>
                                    <p className="item-btn-text">{item}</p>
                                </a>
                            );
                        })}
                    </div>
                    <div className="item-card">
                        <div className="svg-container">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1500 400" className='item-svg'>
                                <path fill="#0099ff" fill-opacity="1" d="M0,192L26.7,197.3C53.3,203,107,213,160,229.3C213.3,245,267,267,320,266.7C373.3,267,427,245,480,250.7C533.3,256,587,288,640,293.3C693.3,299,747,277,800,245.3C853.3,213,907,171,960,138.7C1013.3,107,1067,85,1120,74.7C1173.3,64,1227,64,1280,85.3C1333.3,107,1387,149,1413,170.7L1440,192L1440,320L1413.3,320C1386.7,320,1333,320,1280,320C1226.7,320,1173,320,1120,320C1066.7,320,1013,320,960,320C906.7,320,853,320,800,320C746.7,320,693,320,640,320C586.7,320,533,320,480,320C426.7,320,373,320,320,320C266.7,320,213,320,160,320C106.7,320,53,320,27,320L0,320Z"></path>
                            </svg>
                        </div>
                        <h2 className="item-title">{currItem.title}</h2>
                        <p className="item-description">{currItem.description}</p>
                    </div>
                </div>
            </div>
        )
    }
}
